                <div class="circle-text">
                  Product matrix to fulfil user demand in <span class="bold f16">liquidity, borrowing/lending</span> and more <span class="bold f16">advanced trading products</span> in a decentralized way. It allows the assets issued on different parachains to gain liquidity and to be used as collateral in the ecosystem. 
                </div>
              </div>
              <div v-show="a==2"  class="circle1">
                <div>
                  <img src="../assets/page-circle2.png" alt="">
                </div>
                <div class="circle-text">
                 <span class="bold">KONOMI</span> blockchain is built using the Substrate framework and it plugs into Polkadot consensus layer to ensure system level security. It supports smart contract development to integrate with existing DeFi protocols seamlessly.  
                </div>
              </div>
              <div v-show="a==3"  class="circle1">
                <div>
                  <img src="../assets/page-circle3.png" alt="">
                </div>
                <div class="circle-text">
                  Compared with DeFi products based on the Ethereum network, Konomi offers better blockchain infrastructure due to the base layer consensus, virtual machine and more scalable system architecture.

                </div>
