<script>
import headNav from '../components/head'
import foot from '../components/foot'
export default {
  components:{
    foot,headNav
  },
  props: {},
  data() {
    return {
      navActive:0,
      a:4,
      b:1,
      active:'0',
      showThank:false,
    };
  },
  watch: {},
  computed: {
   
  },
  mounted() {
    window.addEventListener('scroll',this.btn_pos); 
  },
  methods: {
    handScroll(){
      this.$el.querySelector(`#id1`).scrollIntoView({
        behavior: "smooth",  // 
        block:    "start"  // 
      });
      this.$el.querySelector(`#id1Mobile`).scrollIntoView({
        behavior: "smooth",  // 
        block:    "start"  // 
      });
    },
    btn_pos:function(){
      //
      var height=document.documentElement.clientHeight
      var scrollTop = document.body.scrollTop || document.documentElement.scrollTop;
      if(scrollTop>height){
        this.navActive=1
      }else{
        this.navActive=0
      }     
      //>
    },
    toProduct(path){
      document.getElementById("header").scrollIntoView();
      this.$router.push('Product')
    },
    toSendEmail(id){
      console.log("123123");
      document.getElementsByClassName("support-ipt")[id].scrollIntoView({behavior: "smooth", block: "center"});
    },
    openPdf(){
      window.location.href="https://www.konomi.network/pdf/KonomiWhitepaper_Final-2.pdf"
    },
    changeThank(){
      this.showThank=!this.showThank
    },
    onSlideChange(val){
      this.active=this.swiper.activeIndex
    },
    changeCircle(a){
      if(this.a==a){
        this.a=4
      }else{
        this.a=a;
      }
    },
    readMore(type){
      if(type==1){
        window.location.href="https://medium.com/konomi/polkadot-ecosystem-analysis-f8fa6b56ebb4"
      }else if(type==2||type==3){
        window.location.href="https://medium.com/konomi/the-product-and-use-cases-of-konomi-74c7b03a8812"
      }else if(type==4||type==5){
        window.location.href="https://medium.com/konomi/the-technical-design-of-konomi-6ba8c86b1c15"
      }
    }
  },
  created(){
  }
};
</script>
